ПИТАНИЕ СФИНКСОВ

Выбирая между сухим и натуральным кормом, лучше всего посоветоваться с заводчиком и узнать у него, к какой еде привыкло животное. Переучивать кота к другому виду корма достаточно сложно, поэтому проще всего придерживаться того рациона, который предпочел заводчик.

НАТУРАЛЬНАЯ ЕДА

Если вы решили кормить сфинкса натуральной едой, покупайте для него кисломолочные продукты, рыбу, мясо (телятину, курицу, индейку), различные субпродукты, яйца, овощи, фрукты, зелень, крупы, злаки. Животному нельзя давать следующие виды продуктов:

свинину;
жареные блюда;
колбасу, сосиски;
выпечку, сладости;
рыбные и мясные консервы;
молоко;
куриные кости.

СУХИЕ КОРМА

Для сфинксов следует выбирать те сухие корма, которые относятся к более высокому классу, чем «эконом». В продуктах эконом-класса содержится множество балластных ингредиентов и мало полезных веществ, поэтому они способны навредить здоровью животного. Дорогостоящие сухие корма характеризуются высоким содержанием мяса и минимальным количеством отдушек, красителей, различных усилителей вкуса. Функцию источника пищевого белка в таких кормах выполняют соя, кукуруза и прочие компоненты.

Выбирая сухой корм для питомца, предпочтение отдавайте продукции, выпускаемой авторитетными, известными на рынке производителями. Такие компании производят качественные, экологически безопасные продукты, не способные нанести даже минимальный вред здоровью домашнего животного. Они сбалансированы по своему составу, поэтому при их использовании питомцу не обязательно дополнительно давать специальные витаминно-минеральные комплексы. Если вы решили давать сфинксу сухой корм, помните, что в этом случае у него всегда должен иметься доступ к питьевой воде. При сухом рационе кот выпивает в несколько раз больше воды, нежели при кормлении натуральными продуктами. Вода для питья сфинкса должна быть чистой и кипяченой.

СКОЛЬКО РАЗ В ДЕНЬ НУЖНО КОРМИТЬ?

До трех месяцев ваш котенок должен питаться шесть раз в сутки. Затем количество кормлений сокращают до пяти раз. Когда животному исполняется полгода, его начинают кормить трижды в сутки. Взрослых кошек желательно кормить всего два раза в день.
